import React, { Component } from 'react';
import './comment1.css';

class Comment1 extends Component {
  render() {
    const comment1 = this.props.comment1;

    return (
      <div className="commentaire1">
        <p>{comment1}</p>
      </div>
    );
  }
}

export default Comment1;
